CREATE TABLE IF NOT EXISTS Primary_Policyholders (
    `FirstName` VARCHAR(30) CHARACTER SET utf8,
    `LastName` VARCHAR(30) CHARACTER SET utf8,
    `DateOfBirth` DATETIME,
    `SSN` VARCHAR(15) CHARACTER SET utf8,
    `Phone` VARCHAR(15) CHARACTER SET utf8,
    `Address` VARCHAR(50) CHARACTER SET utf8,
    `City` VARCHAR(25) CHARACTER SET utf8,
    `ZipCode` VARCHAR(10) CHARACTER SET utf8,
    `State` VARCHAR(5) CHARACTER SET utf8,
    `Email` VARCHAR(50) CHARACTER SET utf8,
    `NumOfDependents` INT,
    `SubmissionDate` VARCHAR(26) CHARACTER SET utf8,
    `Second_Line_Address` VARCHAR(50) CHARACTER SET utf8,
    `Source` VARCHAR(20) CHARACTER SET utf8,
    `UpdatedSubDate` DATETIME,
    `PolicyID` INT,
    `AgentID` INT
);
